import "./topbar.scss";

export default function Topbar() {
  return (
    <div className="topbar" id="topbar">
      <div className="wrapper">

        <div className="left">
          <a href="#intro">asdf</a>
        </div>
        <h1>Hello</h1>

        <div className="right">
          this is right
        </div>

      </div>
    </div>
  );
}
